import React from 'react';
import SideMenu from "./SideMenu";
import TopMenu from "../layout/TopMenu";

export default props => (
    <div className="grid">
        <div className="menu">
            <TopMenu/>
        </div>
        <div className="main-content">
            <SideMenu />
        </div>
    </div>
);
